import Vue from 'vue';            
import Router from 'vue-router';
import App from './pages/App.vue'
import Event from './pages/Event.vue'

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [

    {   

      path: '/',             
      name: App,      
    }
    ,  {   

      path: '/event',             
      name: Event,      
    },
  ]
});
new Vue({
  el: '#app',
  render: h => h(App),

});
